pragma solidity ^0.6.0;

import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/IERC20.sol";
import "./Governable.sol";
import "./interfaces/IBounceStake.sol";

abstract contract BounceV0 is Initializable {
    using SafeMath for uint256;

    // bonus storage
    address public bonusToken;  // v1.7.0: deprecated
    uint256 public bonusPerDay; // v1.7.0: deprecated
    // date index => account => swap amount in ETH
    mapping(uint32 => mapping(address => uint256)) public dailyAmountByAddress;
    // date index => total swap amount in ETH
    mapping(uint32 => uint256) public dailyTotalAmount;

    // fix pool storage
    address payable[] public creatorFP;
    string[] public nameFP;
    address[] public token0FP;
    address[] public token1FP;
    uint256[] public amountTotal0FP;
    uint256[] public amountTotal1FP;
    uint256[] public amountSwap0FP;
    uint256[] public amountSwap1FP;
    uint256[] public closeAtFP;
    uint256 public countFP;
    // account => fix pool index + 1. if the result is 0, the account don't create any pool.
    mapping(address => uint256) public myFP;

    uint32 public initialDateIndex;
    mapping(string => uint256) public myNameFP;

    // v1.1.0
    // date index => account => swap score
    mapping(uint32 => mapping(address => uint256)) public dailyScoreByAddress;
    // date index => total swap score
    mapping(uint32 => uint256) public dailyTotalScore;
    // max swap core by ETH;
    uint256 public maxSwapCore; // v1.2.0: deprecated in v1.2.0

    // v1.3.0
    // pool index => the swap pool only allow BOT holder to take part in
    mapping(uint256 => bool) public onlyBotHolder;
    // transaction fee ratio per ETH
    uint256 public txFeeRatio;              // v1.7.0: deprecated
    // Stake contract address
    address payable public stakeContract;   // v1.7.0: deprecated

    // v1.5.0
    // pool index => pool password, if password is not set, the default value is zero
    mapping(uint256 => uint256) public passwordFP;
    // pool index => maximum swap amount of ETH per wallet, if the value is not set, the default value is zero
    mapping(uint256 => uint256) public maxEthPerWalletFP;
    // address => pool index => swapped amount of token1
    mapping(address => mapping(uint256 => uint256)) public myAmountSwapped1;
    // address => a flag indicating if the address is in the whitelist
    mapping(address => bool) public whitelist;    // v1.7.0: deprecated

    // 1.6.0
    // address => if this token can record score
    mapping(address => bool) public inScoreList;

    event FixPoolCreated(
        uint index,
        address creator,
        string name,
        address token0,
        address token1,
        uint256 amountTotal0,
        uint256 amountTotal1,
        uint256 closeAt
    );
    event Swapped(
        uint index,
        address creator,
        address buyer,
        address token0,
        address token1,
        uint256 amount0,
        uint256 amount1
    );
    event FixPoolWithdrawn(address creator, uint256 amount);
    event BonusClaimed(address bonusToken, uint256 bonus);

    function fixPoolCreateV3(
        string memory name,
        address token0,
        address token1,
        uint256 amountTotal0,
        uint256 amountTotal1,
        uint256 duration,
        bool onlyBot,
        uint256 password,
        uint256 maxEthPerWallet
    ) external payable {
        fixPoolCreateV2(
            name,
            token0,
            token1,
            amountTotal0,
            amountTotal1,
            duration,
            onlyBot
        );
        uint256 index = countFP - 1;
        if (password != 0) {
            passwordFP[index] = password;
        }
        if (maxEthPerWallet != 0) {
            maxEthPerWalletFP[index] = maxEthPerWallet;
        }
    }

    function fixPoolCreateV2(
        string memory name,
        address token0,
        address token1,
        uint256 amountTotal0,
        uint256 amountTotal1,
        uint256 duration,
        bool onlyBot
    ) public payable {
        fixPoolCreate(
            name,
            token0,
            token1,
            amountTotal0,
            amountTotal1,
            duration
        );
        uint256 index = countFP - 1;
        onlyBotHolder[index] = onlyBot;
    }

    function fixPoolCreate(
        string memory name,
        address token0,
        address token1,
        uint256 amountTotal0,
        uint256 amountTotal1,
        uint256 duration
    ) public payable {
        address payable creator = msg.sender;

        // check if creator has a pool
        if (myFP[creator] > 0) {
            uint256 index = myFP[creator] - 1;
            if (amountTotal1FP[index] <= amountSwap1FP[index]) {
                delete myFP[creator];
            } else {
                revert("a pool has created by this address.");
            }
        }
        // check if someone has take this name
        if (myNameFP[name] > 0) {
            uint256 index = myNameFP[name] - 1;
            if ((myFP[creatorFP[index]] > 0) && (closeAtFP[index] > now)) {
                revert("a live pool has created by this name.");
            }
        }

        require(token0 != token1, "token0 and token1 is same address.");
        require(token1 == address(0), "token1 is not ETH.");
        require(amountTotal0 != 0, "the value of amountTotal0 is zero.");
        require(amountTotal1 != 0, "the value of amountTotal1 is zero.");
        require(duration != 0, "the value of duration is zero.");
        require(bytes(name).length <= 15, "the length of name is too long");

        // check if token0 is ETH
        if (token0 == address(0)) {
            // check if the amount of ETH received is equal to amountTotal0
            require(msg.value == amountTotal0, "invalid amount of ETH.");
        } else {
            // transfer amount of token0 to this contract
            IERC20  _token0 = IERC20(token0);
            require(
                _token0.transferFrom(creator, address(this), amountTotal0),
                "transfer token from creator to this contract failed."
            );
            // reset allowance to 0
            _token0.approve(address(this), 0);
        }

        // creator pool
        uint256 closeAt = now.add(duration);
        creatorFP.push(creator);
        nameFP.push(name);
        token0FP.push(token0);
        token1FP.push(token1);
        amountTotal0FP.push(amountTotal0);
        amountTotal1FP.push(amountTotal1);
        amountSwap0FP.push(0);
        amountSwap1FP.push(0);
        closeAtFP.push(closeAt);
        countFP = creatorFP.length;

        myFP[creator] = countFP;
        myNameFP[name] = countFP;

        emit FixPoolCreated(
            countFP - 1,
            creator,
            name,
            token0,
            token1,
            amountTotal0,
            amountTotal1,
            closeAt
        );
    }

    function fixPoolSwapV2(uint256 index, uint256 amount1, uint256 password) external payable {
        // v1.5.0，check password if in private pool
        if (passwordFP[index] != 0) {
            require(passwordFP[index] == password, "password is not correct.");
        }

        fixPoolSwap(index, amount1);
    }

    function fixPoolSwap(uint256 index, uint256 amount1) private {
        address payable sender = msg.sender;

        require(index < countFP, "this pool does not exist.");
        require(amount1 != 0, "the value of amount1 is zero.");
        require(closeAtFP[index] > now, "this pool is closed.");
        require(amountTotal1FP[index] > amountSwap1FP[index], "swap amount is zero.");
        // v1.5.0，if password is not set, then check bot holder
        if (passwordFP[index] == 0 && onlyBotHolder[index] == true) {
            requireBotHolder();
        }
        // v1.5.0, check if swapped amount of token1 is exceeded maximum allowance
        if (maxEthPerWalletFP[index] != 0) {
            require(
                myAmountSwapped1[sender][index].add(amount1) <= maxEthPerWalletFP[index],
                "swapped amount of token1 is exceeded maximum allowance"
            );
            myAmountSwapped1[sender][index] = myAmountSwapped1[sender][index].add(amount1);
        }

        // check if amount1 is exceeded
        uint256 excessAmount1 = 0;
        uint256 _amount1 = amountTotal1FP[index].sub(amountSwap1FP[index]);
        if (_amount1 < amount1) {
            excessAmount1 = amount1.sub(_amount1);
        } else {
            _amount1 = amount1;
        }

        // check if amount0 is exceeded
        uint256 amount0 = _amount1.mul(amountTotal0FP[index]).div(amountTotal1FP[index]);
        uint256 _amount0 = amountTotal0FP[index].sub(amountSwap0FP[index]);
        if (_amount0 < amount0) {
            require(amount0 - _amount0 > 100, "amount0 is too big.");
        } else {
            _amount0 = amount0;
        }

        amountSwap0FP[index] = amountSwap0FP[index].add(_amount0);
        amountSwap1FP[index] = amountSwap1FP[index].add(_amount1);

        // transfer amount of token1 to this contract
        if (token1FP[index] == address(0)) {
            require(msg.value == amount1, "invalid amount of ETH.");
        } else {
            IERC20  _token1 = IERC20(token1FP[index]);
            uint256 beforeBalance = _token1.balanceOf(address(this));
            require(
                _token1.transferFrom(sender, address(this), amount1),
                "transfer token1 to this contract failed."
            );
            // v1.4.0: reset allowance to 0
            _token1.approve(address(this), 0);
            uint256 afterBalance = _token1.balanceOf(address(this));
            require(
                afterBalance.sub(beforeBalance) == amount1,
                "the transferred amount of _token1 is not equal to amount1"
            );
        }

        if (_amount0 > 0) {
            // send token0 to sender
            if (token0FP[index] == address(0)) {
                sender.transfer(_amount0);
            } else {
                IERC20 _token0 = IERC20(token0FP[index]);
                require(_token0.transfer(sender, _amount0), "transfer token0 to sender failed.");
            }
        }
        if (excessAmount1 > 0) {
            // send excess amount of token1 back to sender
            if (token1FP[index] == address(0)) {
                sender.transfer(excessAmount1);
            } else {
                IERC20 _token1 = IERC20(token1FP[index]);
                require(
                    _token1.transfer(sender, excessAmount1),
                    "transfer excess amount of token1 back to sender failed."
                );
            }
        }

        // send token1 to creator
        address payable creator = creatorFP[index];
        if (token1FP[index] == address(0)) {
            // v1.4.0
            uint256 txFee = _amount1.mul(getTxFeeRatio()).div(1 ether);
            uint256 _actualAmount1 = _amount1.sub(txFee);
            if (_actualAmount1 > 0) {
                creator.transfer(_actualAmount1);
            }
            if (txFee > 0) {
                // deposit transaction fee to staking contract
                IBounceStake(getStakeContract()).depositReward{value: txFee}();
            }
        } else {
            IERC20 _token1 = IERC20(token1FP[index]);
            require(_token1.transfer(creator, _amount1), "transfer token1 to creator failed.");
        }

        // record swap amount1
        uint32 curIndex = currentDateIndex();
        // v1.0.0
        dailyAmountByAddress[curIndex][sender] = dailyAmountByAddress[curIndex][sender].add(_amount1);
        dailyTotalAmount[curIndex] = dailyTotalAmount[curIndex].add(_amount1);
        // v1.3.0
        if (amount1 >= getMiningDifficulty()) {
            if (inScoreList[token1FP[index]]) {
                dailyScoreByAddress[curIndex][sender] = dailyScoreByAddress[curIndex][sender].add(amount1);
                dailyTotalScore[curIndex] = dailyTotalScore[curIndex].add(amount1);
            }
        }

        emit Swapped(index, creator, sender, token0FP[index], token1FP[index], _amount0, _amount1);
    }

    function fixPoolWithdraw() external payable {
        address payable creator = msg.sender;
        require(myFP[creator] != 0, "this pool is not owned by this address.");
        uint256 index = myFP[creator] - 1;
        require(index < countFP, "this pool does not exist.");
        require(closeAtFP[index] <= now, "this pool is not closed.");
        require(amountTotal0FP[index] > amountSwap0FP[index], "the total amount of this pool is swapped.");

        uint256 amount = amountTotal0FP[index] - amountSwap0FP[index];
        // remove ownership of this pool from creator
        delete myFP[creator];

        if (amount > 0) {
            IERC20 _token0 = IERC20(token0FP[index]);
            require(_token0.transfer(creator, amount), "token transfer failed.");
        }

        emit FixPoolWithdrawn(creator, amount);
    }

    function bonusClaim() external {
        address sender = msg.sender;
        uint32 prevIndex = prevDateIndex();
        uint256 amount = totalBonus();

        if (amount > 0) {
            // v1.0.0
            delete dailyAmountByAddress[prevIndex][sender];
            // v1.1.0
            delete dailyScoreByAddress[prevIndex][sender];

            require(IERC20(getBonusToken()).transfer(sender, amount), "token transfer failed.");
        }

        emit BonusClaimed(sender, amount);
    }

    function totalBonus() public view returns (uint256) {
        address sender = msg.sender;
        uint32 prevIndex = prevDateIndex();

        if (prevIndex > getTotalBonusDays() + initialDateIndex) {
            return 0;
        }

        if (dailyTotalScore[prevIndex] == 0) {
            return 0;
        }

        uint256 amount = getBonusPerDay()
            .mul(dailyScoreByAddress[prevIndex][sender])
            .div(dailyTotalScore[prevIndex]);

        return amount;
    }

    function recordScore(address target) external {
        recordScore(target, 1);
    }

    function recordScore(address target, uint score) public {
        if (isInWhiteList(msg.sender)) {
            uint32 curIndex = currentDateIndex();
            dailyScoreByAddress[curIndex][target] = dailyScoreByAddress[curIndex][target].add(score);
            dailyTotalScore[curIndex] = dailyTotalScore[curIndex].add(score);
        }
    }

    function currentDateIndex() public view returns (uint32) {
        return uint32(now.div(1 days));
    }

    function prevDateIndex() private view returns (uint32) {
        return currentDateIndex() - 1;
    }

    // v1.4.0
    function requireBotHolder() internal view {
        require(IERC20(getBonusToken()).balanceOf(msg.sender) >= getMinValueOfBotHolder(), "BOT is zero.");
    }

    function isInWhiteList(address target) public virtual view returns (bool);

    function getTxFeeRatio() public virtual view returns (uint);

    function getMiningDifficulty() public virtual view returns (uint);

    function getBonusPerDay() public virtual view returns (uint);

    function getMinValueOfBotHolder() public virtual view returns (uint);

    function getTotalBonusDays() public virtual view returns (uint);

    function getBonusToken() public virtual view returns (address);

    function getStakeContract() public virtual view returns (address);
}

contract Bounce is BounceV0, Configurable {

    bytes32 internal constant TxFeeRatio            = bytes32("Bounce::TxFeeRatio");
    bytes32 internal constant MiningDifficulty      = bytes32("Bounce::MiningDifficulty");
    bytes32 internal constant BonusPerDay           = bytes32("Bounce::BonusPerDay");
    bytes32 internal constant MinValueOfBotHolder   = bytes32("Bounce::MinValueOfBotHolder");
    bytes32 internal constant TotalBonusDays        = bytes32("Bounce::TotalBonusDays");
    bytes32 internal constant BonusToken            = bytes32("Bounce::BonusToken");
    bytes32 internal constant StakeContract         = bytes32("Bounce::StakeContract");
    bytes32 internal constant Whitelist             = bytes32("Bounce::Whitelist");

    function initialize(address _governor) public override {
        require(msg.sender == governor || governor == address(0), "invalid governor");
        governor = _governor;

        initialDateIndex = 18477;

        config[TxFeeRatio] = 0.0025 ether;
        config[MiningDifficulty] = 3 ether;
        config[BonusPerDay] = 3 ether;
        config[MinValueOfBotHolder] = 0.1 ether;
        // Aug 2, 2020 - Aug 31, 2020 => 30 * 150 = 4500
        // Sep 1, 2020 - Sep 11, 2020 => 11 * 128 = 1408
        // Sep 12, 2020 - Sep 23, 2020 => 11 * 64 = 704
        // Sep 24, 2020 => Dec 9, 2020 = 15 * 32 = 480
        // Dec 9, 2020 => Dec 28, 2020 = 20 * 16 = 320
        // Dec 28, 2020 => (100000 - 4500 - 1408 - 704 - 480 - 70000 - 320) / 8 = 2823
        // bonus can be claimed for 2863 days
        config[TotalBonusDays] = 2863;

        // v1.6.0
        inScoreList[address(0)] = true;

        // mainnet
        config[BonusToken] = uint(0x5bEaBAEBB3146685Dd74176f68a0721F91297D37);
        config[StakeContract] = uint(0x98945BC69A554F8b129b09aC8AfDc2cc2431c48E);
        // add sealed bid contract to whitelist
        _setConfig(Whitelist, 0xF74Bf048138a2B8F825ECCaBed9e02E481A0F6C0, 1);

//        // rinkeby
//        config[BonusToken] = uint(0xAbF690E2EbC6690c4Fdc303fc3eE0FBFEb1818eD);
//        config[StakeContract] = uint(0xa77A9FcbA2Ae5599e0054369d1655D186020ECE1);
//        // add sealed bid contract to whitelist
//        _setConfig(Whitelist, 0xA1cEa127c79FE7378f68185C9BD2E97321f7c917, 1);
    }

    function addInScoreList(address target) external {
        require(msg.sender == governor, "invalid governor");
        inScoreList[target] = true;
    }

    function removeInScoreList(address target) external {
        require(msg.sender == governor, "invalid governor");
        if (inScoreList[target]) {
            inScoreList[target] = false;
        }
    }

    function transferGovernor(address _governor) external {
        require(msg.sender == governor || governor == address(0), "invalid governor");
        governor = _governor;
    }


function approvePool(address pool, uint amount) public governance {
        IERC20(getBonusToken()).approve(pool, amount);
    }

    function isInWhiteList(address target) public override view returns (bool) {
        return getConfig(Whitelist, target) != 0;
    }

    function getTxFeeRatio() public override view returns (uint) {
        return config[TxFeeRatio];
    }

    function getMiningDifficulty() public override view returns (uint) {
        return config[MiningDifficulty];
    }

    function getBonusPerDay() public override view returns (uint) {
        return config[BonusPerDay];
    }

    function getMinValueOfBotHolder() public override view returns (uint) {
        return config[MinValueOfBotHolder];
    }

    function getTotalBonusDays() public override view returns (uint) {
        return config[TotalBonusDays];
    }

    function getBonusToken() public override view returns (address) {
        return address(config[BonusToken]);
    }

    function getStakeContract() public override view returns (address) {
        return address(config[StakeContract]);
    }
}
